    if (items.length==0){
      return
      <div>there is no item to show</div>
    }else {

    }
    return(
      <div key={e.id}>
         <span>{e.name}</span>
         <span>{e.age}</span>
        <span className="x"onClick={()=>deleteitem(e.id)}>&times;</span>

      </div>
    )

  })
  return(

    <div className="listitems">
    <span>name</span>
